import React from 'react';
import './App.css';
import { Button } from '@material-ui/core';

function RandButton() {

    function Roll(Number) {
        const min = 1;
        const max = Number;
        const rand = min + Math.random() * (max - min);
        console.log(rand);
    }

    return (
        <button onClick={Roll}>
            Click me!
        </button>
    );
}

export default RandButton;
